insert  into `t_scenic`(`s_id`,`s_name`,`s_address`,`s_city`,`s_score`,`s_price`,`s_time`,`s_coordinate`,`s_introduce`,`s_imgsrc`) values (1,'邯郸七步沟','河北省邯郸市武安市活水乡七步沟村','武安市','AAAA',12.00,'6:00~19:00','113.881628,36.938712','七步沟景区，位于河北省邯郸市武安活水乡境内，总面积20平方公里，由门景区、休闲度假区、百瀑峡、罗汉峡、三棱山、马武寨六个景区组成，集绿色、古色、红色旅游资源和独特地质资源之大成。是国家地质公园、国家森','qb1.jpg,qb2.jpg,qb3.jpg,'),(2,'邯郸京娘湖','河北省邯郸市武安市活水乡口上村','武安市','AAAA',12.00,'6:00~19:00','113.957512,36.908142','京娘湖风景区，位于河北省邯郸市武安市西北部山区的口上村北，太行山脉腹地，亦称口上水库，素有“太行三峡”之称。据史料记载，赵匡胤千里送京娘的故事便发生在这里。京娘湖因宋太祖送京娘的故事发生在这一带，故得','j1.jpg,j2.jpg,j3.jpg,'),(3,'石家庄抱犊寨','河北省石家庄市鹿泉区太平河北路与观景大街交叉口','石家庄市','AAAA',0.00,'6:00~19:00','114.283595,38.094246','抱犊寨，旧名抱犊山，古名萆山，位于石家庄市鹿泉区，距省会石家庄16公里，距首都北京200余公里，是一处集历史人文和自然风光为一体的名山古寨。系国家4A级旅游区、河北省旅游先进单位、石家庄十佳旅游景区。','b1.jpg,b2.jpg,b3.jpg,'),(4,'石家庄封龙山','河北省石家庄市鹿泉区铜冶镇登峰街封龙山风景区陶然山居','石家庄市','AAAA',50.00,'6:00~19:00','114.359867,37.918756','封龙山又名飞龙山，位于河北省省会石家庄市鹿泉区西南约十五公里。西倚太行，东临平原，主峰海拔812米，巍然崛起，雄伟壮观。封龙山主峰812米，东西绵亘11公里，南北纵跨约10公里，山间奇峰怪石，幽谷绿荫','f1.jpg,f2.jpg,f3.jpg,'),(5,'石家庄植物园','河北省石家庄市新华区大河镇迎宾路石家庄植物园','石家庄市','AAAA',20.00,'6:00~19:00','114.391853,38.107699','植物园拥有波澄湖景区，盆景艺术馆，热带植物观赏厅，科普馆，玫瑰艺术广场，廊桥水榭，湖心岛，水中莲花，步步叠水、世纪钟等38个景点，并形成松柏苑，牡丹园，芍药园，蔷薇园，樱花园，碧桃园，海棠园，丁香园。','plant1.jpg,plant2.jpg,plant3.jpg,'),(6,'邯郸广府古城','河北省邯郸市永年区广府镇广府专线','永年区','AAAA',0.00,'6:00~19:00','114.736727,36.707347','位于邯郸东北方向20公里处，距今已有2000多年的历史。广府有很多历史遗存，如清晖书院、文庙大殿（遗址）、毛遂墓、黑龙潭，武氏故居、状元楼、太和堂等等。城内面积为1.5平方公里，历史上官署棋布，庙宇半','g1.jpg,g2.jpg,g3.jpg,'),(7,'张家口草原天路','河北省张家口市张北县','张北县','AAAA',0.00,'6:00~20:00','114.748015,41.022768','草原天路，位于张家口市张北县和崇礼区的交界处，西起尚义县城南侧的大青山（国家级森林公园），东至崇礼县桦皮岭处，是连接崇礼滑雪区、赤城温泉区、张北草原风景区、白龙洞风景区、大青山风景区的一条重要通道，也','c1.jpg,c2.jpg,c3.jpg,'),(8,'秦皇岛山海关','河北省秦皇岛市山海关区东大街1号','秦皇岛市','AAAA',0.00,'6:00~19:00','119.767232,40.016497','山海关，又称榆关、渝关、临闾关，位于河北省秦皇岛市东北15千米处，是明长城的东北关隘之一，在1990年以前被认为是明长城东端起点，素有中国长城“三大奇观之一”（东有山海关、中有镇北台、西有嘉峪关）、“','s1.jpg,s2.jpg,s3.jpg,'),(9,'秦皇岛北戴河海滨','河北省秦皇岛市北戴河中海滩路5号','秦皇岛市','AAAA',0.00,'6:00~19:00','119.510047,39.824857','秦皇岛蜿蜒几十公里的海岸线，几乎全都是洁净的沙滩和靓丽的风景，其中尤其是北戴河的海岸线蜿蜒曲奇，礁石与沙滩交替变换，造就了北戴河闻名于世的美丽风景，其间市大大小小的海滨。秦皇岛海滨从东向西的海滨其实到','h1.jpg,h2.jpg,h3.jpg,'),(10,'承德避暑山庄','河北省承德市双桥区丽正门大街22号','承德市','AAAA',0.00,'6:00~19:00','117.941207,41.001475','承德避暑山庄，又名“承德离宫”或“热河行宫”，是世界文化遗产、国家AAAAA级旅游景区、全国重点文物保护单位、中国四大名园之一。山庄位于河北省承德市中心北部，武烈河西岸一带狭长的谷地上，是清代皇帝夏天','bs1.jpg,bs2.jpg,bs3.jpg,'),(11,'保定白洋淀','河北省保定市安新县旅游东路','安新县','AAAAA',0.00,'6:00~19:00','115.978733,38.945535','保定市安新白洋淀景区，是河北第一大内陆湖，总面积366平方公里，位于河北省中部，地处京津冀腹地，南距石家庄189公里，北距北京162公里，东距天津155公里。白洋淀景区自古就以物产丰富、风景秀丽闻名于','by1.jpg,by2.jpg,by3.jpg,'),(12,'保定野三坡','河北省保定市涞水县','涞水县','AAAA',0.00,'6:00~19:00','115.508873,39.657025','野三坡风景名胜区位于河北省涞水县，太行山脉和燕山山脉交汇处，它以“雄、险、奇、幽”的自然景观和古老的历史文物，享有世外桃源之美誉，以其独特的魅力，深受海内外游人的喜爱。景区总面积498平方公里，主要景','y1.jpg,y2.jpg,y3.jpg,'),(13,'邯郸娲皇宫','河北省邯郸市涉县索堡镇','涉县','AAAAA',0.00,'6:00~19:00','113.624308,36.64729','娲皇宫，位于河北省邯郸市涉县中皇山上，占地面积5平方公里，由服务区、补天园、补天湖、娲皇宫和补天谷五个园区组成，是神话传说中女娲 “抟土造人、炼石补天”的地方，是我国建筑规模最大、肇建时间最早的祀奉人','w1.jpg,w2.jpg,w3.jpg,'),(14,'唐山清东陵','河北省唐山市遵化市六盘营村清东陵支线','遵化市','AAAAA',0.00,'6:00~19:00','117.708723,40.176631','清东陵位于河北省唐山市遵化市西北30公里处，西距北京市区125公里，占地80平方公里。是中国现存规模最宏大、体系最完整、布局最得体的帝王陵墓建筑群。清东陵于1661年（顺治十八年）开始修建，历时247','q1.jpg,q2.jpg,q3.jpg,'),(15,'保定白石山','河北省保定市涞源县白石山镇丰凉沟村','涞源县','AAAAA',0.00,'6:00~19:00','114.722083,39.242194','白石山，位于河北省保定市涞源县城南15千米，太行山最北端，由100多座高低错落、相对独立的山峰组成，主峰海拔2096米。战国时度岭分燕赵，辽宋时一山分两国。白石山因山体遍布白色大理石而得名，为大理岩构','bss1.jpg,bss2.jpg,bss3.jpg,'),(16,'邢台天河山','河北省邢台市信都区','邢台市','AAAA',10.00,'6:00~19:00','114.474393,37.066172','好地方','481b2337b80e4b31b208102a038dd51b.jpg,7846bcc03b50434095ff81109ad8dbe8.jpg,5fdca6ce03ee4e6eacaea9e77c45fc34.jpg,'),(17,'邢台云梦山','河北省邢台市信都区冀家村乡石板房村','邢台市','AAAA',0.00,'6:00~19:00','113.940226,37.329164','真不错！','85bac8ddec88482da4cfc76208d84382.jpg,1b30f7bc6707460e9f335e69a99a2105.jpg,2851e447d0fa464780f47bfcbcc9cfe7.jpg,'),(18,'北京市景点','北京市朝阳区北辰世纪中心b座','北京市','100',10.00,'6:00~19:00','116.394384,40.005545','好1！！','4943766f3d6e483bbd4f326739ecb870.jpeg,3bbf2809593b4f51b6fb86767acff451.jpg,541e8553dd83431a937b2b848ceaf681.jpg,');

